`,W.jsx(t.li,{children:"the internals of all functional Polkadot node implementations;"}),`
`,W.jsx(t.li,{children:"cryptographic data-structures, algorithms, languages and APIs required for the continued upkeep of the Polkadot (Main) Network;"}),`
